import * as React from 'react';
import { styled } from '@mui/material/styles';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import ChillImage from "../images/chilldood.png";

const Item = styled(Paper)(({ theme }) => ({
  textAlign: 'center',
}));

function Chill() {
  // Import result is the URL of your image
  return <img src={ChillImage} alt="Dood Chills" />;
}

export default function BasicGrid() {
  return (
      <Grid container spacing={2} style={{ height: "auto", display: "flex", backgroundColor: "#384885", padding: "40px"}}>
        <Grid item xs={ 12 } md= {6}>
          <Item elevation={2} style={{backgroundColor: "#24305e", color: "#ffffff", minHeight:"600px", padding: "40px"}}>
            <h1 style={{ display: "flex", justifyContent: "left", fontStyle:"italic", fontSize: "24px"}}>
              WELCOME TO THE GOOD DOODS CLUB </h1>
            <h2 style={{ display: "flex", justifyContent: "left", textAlign: "justify", fontSize:"18px"}}>

                GDC is a collection of 5001 Good Dood NFTs- unique digital collectibles
                living on the Solana blockchain. Good Doods doubles as proof of giving.
                Our initial mint will generate over 10,000 gifts for St Jude Kids.


              </ h2>

              <h2 style={{ display: "flex", justifyContent: "left", textAlign: "justify", fontSize:"18px"}}>

              Each quarter 100 of you Good Doods will be rewarded with the gifts featured in your Good Dood Club
              membership card.


</ h2>    
          </Item>
        </Grid>
        <Grid item xs={12} md={6}>
          <Item elevation={0}  style={{backgroundColor: "#384885"}}>

          <img src={ChillImage} alt="Logo"
            style={{
              maxWidth: "100%",
              minWidth: "300px",
              height: "auto",
              marginLeft: "20px",
          }}
          />

          </Item>
        </Grid>
      </Grid>
  );
}
